import React, { useEffect, useState } from "react";
import { useLocalSearchParams } from "expo-router";
import { Progress } from "@/components/ui/progress";
import { Button } from "@/components/ui/button";
import { Card } from "@/components/ui/card";
import { ScrollView, View, Text, Image } from "react-native";

const PlantInfo = () => {
  const { name, imageUrl, species } = useLocalSearchParams();
  const [temperature, setTemperature] = useState(0);
  const [moistureLevel, setMoistureLevel] = useState(0);
  const [lightLevel, setLightLevel] = useState(0);
  const [nitrogenLevel, setNitrogenLevel] = useState(0);
  const [phosphorusLevel, setPhosphorusLevel] = useState(0);
  const [potassiumLevel, setPotassiumLevel] = useState(0);
  const [recommendation, setRecommendation] = useState("");
  const [recommended, setRecommended] = useState(null);

  useEffect(() => {
    fetch("http://localhost:3001/api/sensor/latest")
      .then((res) => res.json())
      .then((data) => {
        setTemperature(data.temperature);
        setMoistureLevel(data.moisture);
        setLightLevel(data.light);
        setNitrogenLevel(data.nitrogen);
        setPhosphorusLevel(data.phosphorus);
        setPotassiumLevel(data.potassium);
      });

    fetch("http://localhost:3001/api/openai/care-recommendation", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ species }),
    })
      .then((res) => res.json())
      .then((data) => setRecommendation(data.careRecommendation));

    fetch("http://localhost:3001/api/openai/recommended-values", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ species }),
    })
      .then((res) => res.json())
      .then((data) => setRecommended(data));
  }, []);

  return (
    <ScrollView className="p-4">
      <View className="max-w-4xl mx-auto">
        <View className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <Image
            source={{ uri: imageUrl }}
            className="w-full h-64 rounded-lg"
            resizeMode="cover"
          />

          <View className="space-y-2">
            <Text className="text-xl font-bold">{name}</Text>
            <Text className="text-sm text-gray-500">{species}</Text>
          </View>

          <Card className="p-4">
            <Text className="font-medium mb-2">ค่าจากเซนเซอร์</Text>
            <Progress label="🌱 ความชื้นในดิน" value={moistureLevel} />
            <Progress label="🌞 แสง" value={lightLevel} />
            <Progress label="🧪 ไนโตรเจน (N)" value={nitrogenLevel} />
            <Progress label="🧪 ฟอสฟอรัส (P)" value={phosphorusLevel} />
            <Progress label="🧪 โพแทสเซียม (K)" value={potassiumLevel} />
          </Card>

          {recommended && (
            <Card className="p-4">
              <Text className="font-medium mb-2">ค่าที่แนะนำจาก AI</Text>
              <Progress label="🌱 ความชื้นในดิน" value={recommended.moistureLevel} />
              <Progress label="🌞 แสง" value={recommended.lightLevel} />
              <Progress label="🧪 N" value={recommended.npkNitrogen} />
              <Progress label="🧪 P" value={recommended.npkPhosphorus} />
              <Progress label="🧪 K" value={recommended.npkPotassium} />
            </Card>
          )}

          <Card className="p-4 col-span-full">
            <Text className="font-medium mb-2">คำแนะนำในการดูแล</Text>
            <Text className="text-sm whitespace-pre-line">{recommendation}</Text>
          </Card>

          <View className="col-span-full flex flex-row gap-4">
            <Button className="flex-1" variant="outline">
              รดน้ำ
            </Button>
            <Button className="flex-1">ใส่ปุ๋ย</Button>
          </View>
        </View>
      </View>
    </ScrollView>
  );
};

export default PlantInfo;
